import React from "react";
import { PlusOutlined } from "@ant-design/icons";
import {
  Form,
  Input,
  Button,
  Select,
  InputNumber,

  Upload,
} from "antd";

const Productform = () => {
  return (
    <>
      <Form
        labelCol={{ span: 13 }}
        wrapperCol={{ span: 20 }}
        layout="horizontal"
        style={{backgroundColor:"white"}}
      >
        <Form.Item style={{ color: "white"}} label="Ttitle" name='Prodtitle'> 
          <Input />
        </Form.Item>

        <Form.Item style={{ color: "black" }} label="Description" > 
          <Input />
        </Form.Item>
        <Form.Item label="Category" style={{ color: "white" }}>
          <Select>
            <Select.Option value="demo">Demo</Select.Option>
          </Select>
        </Form.Item>
        <Form.Item label="Price">
          <InputNumber />
        </Form.Item>
        <Form.Item label="Upload" valuePropName="fileList">
          <Upload action="/upload.do" listType="picture-card">
            <div>
              <PlusOutlined />
              <div style={{ marginTop: 8 }}>Upload</div>
            </div>
          </Upload>
        </Form.Item>
        <Form.Item>

          <Button type="default">Cancel</Button>
          <Button type="primary">Submit</Button>
        </Form.Item>
      </Form>
    </>
  );
};

export default Productform;
